import { Link } from 'react-router-dom';
import './style.css'

const DoctorItem = (props) => {
    const { category } = props;
    return (
        <li className='doctor-item'>
            <Link to={`/doctors/${category.id}`} className='link'>
                <img src={category.imageUrl} alt={category.doctorName} className='doctor-image' />
                <div className="doctor-details">
                    <h1 className='doctor-name'>{category.doctorName}</h1>
                    <p className='doctor-type'>{category.doctorType}</p>
                    <p className='doctor-location'>{category.location}</p>
                </div>
            </Link>
        </li>
    )
}

export default DoctorItem;
